import React from 'react';
import '../styles/Global.css';


const Membership = () => {
  const membershipPlans = [
    {
      title: 'Hot Desk',
      price: '$250/month',
      features: [
        'Flexible workspace',
        'Access to all locations',
        'High-speed internet',
        'Complimentary tea & coffee',
      ],
    },
    {
      title: 'Dedicated Desk',
      price: '$400/month',
      features: [
        'Your own desk',
        '24/7 access',
        'Premium meeting rooms',
        'Mailbox service included',
      ],
    },
    {
      title: 'Private Office',
      price: 'Custom Pricing',
      features: [
        'Private office space',
        'Custom branding',
        'All-inclusive amenities',
        'Dedicated account manager',
      ],
    },
  ];

  return (
    <div className="membership">
      {/* Header Section */}
      <header className="membership-header">
        <h1>Membership Plans</h1>
        <p>Choose the perfect plan for your needs and enjoy the benefits of coworking.</p>
      </header>

      {/* Membership Plans */}
      <section className="membership-plans">
        {membershipPlans.map((plan, index) => (
          <div className="membership-card" key={index}>
            <h2>{plan.title}</h2>
            <p className="price">{plan.price}</p>
            <ul>
              {plan.features.map((feature, idx) => (
                <li key={idx}>{feature}</li>
              ))}
            </ul>
            <button className="join-btn">Join Now</button>
          </div>
        ))}
      </section>

      {/* Benefits Section */}
      <section className="membership-benefits">
        <h2>Why Join Us?</h2>
        <ul>
          <li>Flexible terms and plans</li>
          <li>Access to multiple locations</li>
          <li>Vibrant coworking community</li>
          <li>Exclusive networking events</li>
        </ul>
      </section>

      {/* Call to Action */}
      <div className="membership-cta">
        <h2>Ready to Get Started?</h2>
        <button className="cta-btn">Become a Member</button>
      </div>
    </div>
  );
};

export default Membership;
